import React, { useState } from 'react';
import { TextField } from '@mui/material';
import Grid from '@mui/material/Grid';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';

const AddProduct = ({ formData, setFormData, selectedFile, setSelectedFile }: any) => {
    function change_image(e: any) {
        let file = e.target.files[0]
        if (!file) {
            return
        }
         let url = URL.createObjectURL(file)
        // setSelectedFile({
        //     file: file,
        //     url: url
        // })
        setFormData((prevFormData: any) => ({
            ...prevFormData,
            img: file
        }));
        console.log('file', file);
    }
    const handleChange =async (e: any) => {
        // const { name, value,files } = e.target;
        const name = e.target?.name
        const value = e.target?.value ? e.target?.value : ''
        const files = e.target?.files
        if (name.startsWith('features.')) {
            const featureField = name.split('.')[1];
            setFormData((prevFormData: any) => ({
                ...prevFormData,
                features: {
                    ...prevFormData.features,
                    [featureField]: value,
                },
            }));
        }
        else if (name === 'img' && files && files.length > 0) {
            const filesImg: any = files[0];
            setFormData((prevFormData: any) => ({
                ...prevFormData,
                img: filesImg
            }));
          }
        else if (name.startsWith('ratings.')) {
            const featureField = name.split('.')[1];
            setFormData((prevFormData: any) => ({
                ...prevFormData,
                ratings: {
                    ...prevFormData.ratings,
                    [featureField]: value,
                },
            }));
        }
        else {
            setFormData((prevFormData: any) => ({
                ...prevFormData,
                [name]: value,
            }));
        }
    };

    const [formDataFormat, setFormDataFormat] = useState(new FormData());

// const handleChange = async (e: any) => {
//   const name = e.target?.name;
//   const value = e.target?.value ? e.target?.value : '';
//   const files = e.target?.files;

//   const updatedFormData = new FormData(formDataFormat);

//   if (name.startsWith('features.')) {
//     const featureField = name.split('.')[1];
//     updatedFormData.set(`features.${featureField}`, value);
//   } else if (name === 'img' && files && files.length > 0) {
//     const filesImg = files[0];
//     updatedFormData.set('img', filesImg);
//   } else if (name.startsWith('ratings.')) {
//     const featureField = name.split('.')[1];
//     updatedFormData.set(`ratings.${featureField}`, value);
//   } else {
//     updatedFormData.set(name, value);
//   }

//   setFormDataFormat(updatedFormData);
// };

//  React.useEffect(() => {
//     console.log('selectedFile',selectedFile);

//    return () => {
//     console.log('selectedFile',selectedFile);
//    }
//  }, [selectedFile])

    return (
        <React.Fragment>
            <form>
                <Grid container spacing={3}>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="title"
                            label="Title"
                            value={formData?.title}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="desc"
                            label="Description"
                            value={formData?.desc}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="brand"
                            label="Brand"
                            value={formData?.brand}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <FormControlLabel
                            control={<Checkbox color="secondary" name="available" value={formData?.available}
                                onChange={handleChange} />}
                            label="Available"
                        // variant="standard"
                        />
                        {/* <TextField
                            name="available"
                            label="Available"
                            value={formData?.available}
                            onChange={handleChange}
                            required
                            variant="standard"
                        /> */}
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField  
                            type="file"
                            name="img"
                            label="Image"
                            // value={formData?.img?.name}
                            inputProps={{
                                accept: 'image/*',
                              }}
                            onChange={handleChange}
                            // onChange={(e) => change_image(e)}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="categories"
                            label="Categories"
                            value={formData?.categories}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="features.ram"
                            label="RAM"
                            value={formData?.features?.ram}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="features.rom"
                            label="ROM"
                            value={formData?.features?.rom}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="features.screenSize"
                            label="Screen Size"
                            value={formData?.features?.screenSize}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="features.secondaryCamera"
                            label="Secondary Camera"
                            value={formData?.features?.secondaryCamera}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="features.primaryCamera"
                            label="Primary Camera"
                            value={formData?.features?.primaryCamera}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="features.batteryCapacity"
                            label="Battery Capacity"
                            value={formData?.features?.batteryCapacity}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="features.warranty"
                            label="Warranty"
                            value={formData?.features?.warranty}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="price"
                            label="Price"
                            value={formData?.price}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            name="discountPercentage"
                            label="Discount Percentage"
                            value={formData?.discountPercentage}
                            onChange={handleChange}
                            required
                            variant="standard"
                        />
